import React ,{Component} from "react";

export default class Main extends  Component{

    state = {
        initView : true ,
        loading : false ,

    }

    render() {
        return(
            <div className="row">
                {

                    <div className = "card">
                        <a href="https://github.com.reactjs" target='_blank'>
                            <img src="logo192.png" style={{width : 100}}/>
                        </a>

                        <p className = "card-text">react.js</p>
                    </div>

                }
            </div>
        )
    }
}
